CREATE DEFINER=`root`@`localhost` FUNCTION `GetCGPA` (`studentIDN` VARCHAR(15), `StudentLevel` VARCHAR(9), `ResultTerm` VARCHAR(9), `ResultSession` VARCHAR(9)) RETURNS DOUBLE NO SQL
    DETERMINISTIC
BEGIN
	DECLARE score Double DEFAULT 0;
	DECLARE cgpa Double DEFAULT 0;
	DECLARE score_count INTEGER DEFAULT 0;
	DECLARE cummulativeSemesterGradeUnits Double DEFAULT 0;
	DECLARE v_finished INTEGER DEFAULT 0;

	-- declare cursor for student score
 DEClARE score_cursor CURSOR FOR 
 SELECT ResultScore FROM Subject, Result 
                    WHERE SubjectCode = ResultSubjectCode AND Term = ResultTerm
                    AND result.ResultTerm = subject.Term 
                    AND ResultScore is not null AND Studentlevel = StudentLevel AND ResultStudentIDN = studentIDN ;
 
 -- declare NOT FOUND handler
 DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_finished = 1;
 
 OPEN score_cursor;
 
