 FETCH FROM score_cursor INTO score;
 
 
 IF v_finished = 1 THEN 
 LEAVE get_score;
 END IF;
 
 CASE
    WHEN score >= 70 THEN SET cummulativeSemesterGradeUnits = cummulativeSemesterGradeUnits + 5; 
	WHEN score < 70 AND score >= 60 THEN SET cummulativeSemesterGradeUnits = cummulativeSemesterGradeUnits + 4;
	WHEN score < 60  AND score >= 50 THEN SET cummulativeSemesterGradeUnits = cummulativeSemesterGradeUnits + 3;
	WHEN score < 50 AND score >= 45 THEN SET cummulativeSemesterGradeUnits = cummulativeSemesterGradeUnits + 2;
	WHEN score < 45 AND score >= 40 THEN SET cummulativeSemesterGradeUnits = cummulativeSemesterGradeUnits + 1;
ELSE
