END CASE;
 
	
	SET score_count = score_count + 1;
 
 
 
 
 
 END LOOP get_score;
 
 CLOSE score_cursor;
 
  SET cgpa = cummulativeSemesterGradeUnits / score_count;
	
 
 RETURN cgpa;
 
